import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Importing routing components
import Login from './components/Login/Login';  // Import Login component
import Home from './components/Home/Home';  // Import Home component
import GovernmentServices from './components/GovernmentServices/GovernmentServices';  // Import GovernmentServices component
import Tutorials from './components/Tutorial/Tutorials';  // Correct import path for Tutorials component

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Route for Login page */}
        <Route path="/" element={<Login />} />  {/* Default route */}

        {/* Route for Home page */}
        <Route path="/home" element={<Home />} />

        {/* Route for Government Services page */}
        <Route path="/government-services" element={<GovernmentServices />} />

        {/* Route for Tutorials page */}
        <Route path="/tutorials" element={<Tutorials />} />
      </Routes>
    </Router>
  );
};

export default App;
